import { NavLink } from "react-router-dom";
import "./SideBar.css";

function sidebar() {
  return (
    <aside className="sidebar">
      <h2 className="logo">MyApp</h2>

      <nav className="nav">
        <NavLink 
          to="/" 
          className={({ isActive }) => isActive ? "nav-link active" : "nav-link"}
        >
          Dashboard
        </NavLink>

        <NavLink 
          to="/profile" 
          className={({ isActive }) => isActive ? "nav-link active" : "nav-link"}
        >
          Profile
        </NavLink>

        <NavLink 
          to="/settings" 
          className={({ isActive }) => isActive ? "nav-link active" : "nav-link"}
        >
          Settings
        </NavLink>
      </nav>
    </aside>
  );
}

export default sidebar;
